import React, { PureComponent } from "react";
import AddUser from "../Components/AddUser";


class User extends PureComponent {
  constructor() {
    super();
    this.state = {
      fetchedData: [],
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData() {
    // console.log("Fetch Data")
    fetch('http://localhost:8081/user',{ method: 'GET'})
      .then((res) => {
        // console.log(res)
        return res.json()})
      .then((fetchedData) => {
        // console.log(fetchedData);
        this.setState({ fetchedData });
      }).catch((ex)=>{
        console.log(ex,"************")
      });
  }

  render() {

    return (<div>
        <div > Name : &nbsp; 
            {this.props.user.userName}
        </div>
        <div > Phone no. : &nbsp; 
            {this.props.user.userPhoneNo}
        </div>
        <div > Email : &nbsp; 
            {this.props.user.userEmail}
        </div>
        <div > Blood Group : &nbsp; 
            {this.props.user.bloodGroup}
        </div>


        <br></br>
    </div>
    )
}
}

export default User;
